import React from "react";
import "../css/Header.css";

export default function Header() {
  return (
    <header>
      <a href="/">SkyFinder</a>
      <nav>
        <ul>
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">About</a>
          </li>
          <li>
            <a href="#">Contact</a>
          </li>
        </ul>
      </nav>
    </header>
  );
}
